import Aside from './Components/Aside';
import Footer from './Components/Footer';

const App: React.FC = () => {
  return (
    <div className="App">
      <header>
      <Header />
      <Banner />
      </header>
      <main>
      <MainTopNavegacao />
      <ProductList />
      </main>
      <aside>
      <Aside />
      </aside>
      <footer>
        <Footer />
      </footer>
    </div>

  );
};

export default App;
